function Header() {
  return (
    <div className="header">
      <div className="menu">
        <div className="menu__options">
          <ul>
            <li>About me</li>
            <li>Projects</li>
            <li>Skills</li>
          </ul>
        </div>
        <div className="menu__btn">
          <button className="btn__first">Contact me</button>
        </div>
      </div>
    </div>
  );
}

export default Header;
